import { request } from "@/utils/request";
export default {

  getCourse: () => request({
    url: '/course',
    method: "get"
  }),

  getMajor: () => request({
    url: '/major',
    method: "get"
  }),

  getTutionByPage: (data) =>request({
    url: '/tuition/page',
    method: 'post',
    data
  })

}
